import React from 'react';
import './has.css'
import $ from 'jquery'

const Has = () => {


    let id = 0
    let data = [{
        subject: 'test question?', exam_data: [{
            id: '1', question: 'what on you mind?', choice: ['boring', 'funny', 'good', 'soso'], ans: '0'
        }, {
            id: '2', question: 'what you color favorite?', choice: ['red', 'green', 'blue', 'pink'], ans: '2'
        }]
    }, {
        subject: 'test question part2 ?', exam_data: [{
            id: '1', question: 'what on you mind?', choice: ['boring', 'funny', 'good', 'soso'], ans: '0'
        }, {
            id: '2', question: 'what you color favorite?', choice: ['red', 'green', 'blue', 'pink'], ans: '2'
        }]
    }]
    $('p.question').text(`${data[0].exam_data[0].question}`)
    for (let choice of data[0].exam_data[0].choice) {
        id++
        $('.main_box').append(`<p><input type="checkbox" 
                       id="bt${id}">
                      <label for="bt${id}">${choice}</label></p>`)
    }

    return (<div className="health-and-safety">
            <div className="main_box">
                <div className="DDL">
                    <a className='dropdown-button btn' data-activates='dropdown1'>Subjects</a>
                    <ul className="dropdown-content" id='dropdown1'>
                        <li><a>1</a></li>
                        <li><a>2</a></li>
                        <li><a>3</a></li>
                    </ul>
                </div>
                <p className="question flow-text"/>
            </div>
        </div>);
};

export default Has;
